import HTTP from '@/config/axiosApi'

const SrvSeries = {
    getTvSeries(payload){
        console.log("Axios")
        console.log(HTTP)
        HTTP.get('/tv/popular',payload).then(respuesta => {
            return respuesta
        }).catch(error => {
            console.error(error)
        })
    }
}

export default SrvSeries;
